import { useMemo } from "react";
import "./Poster1.css";
const Poster1 = ({
  poster1Position,
  poster1BorderRadius,
  poster1FlexShrink,
}) => {
  const poster1Style = useMemo(() => {
    return {
      position: poster1Position,
      borderRadius: poster1BorderRadius,
      flexShrink: poster1FlexShrink,
    };
  }, [poster1Position, poster1BorderRadius, poster1FlexShrink]);

  return (
    <div className="poster-1" style={poster1Style}>
      <div className="poster-1-child" />
      <img className="poster-1-item" alt="" src="/undefined1.png" />
      <img className="poster-1-inner" alt="" src="/undefined2.png" />
      <img className="vector-icon" alt="" src="/undefined2.png" />
      <img className="poster-1-child1" alt="" src="/undefined2.png" />
      <img className="poster-1-child2" alt="" src="/undefined2.png" />
      <img className="poster-1-child3" alt="" src="/undefined2.png" />
      <img className="na-feb-34-1-icon" alt="" src="/undefined3.png" />
      <img className="poster-1-child4" alt="" src="/undefined4.png" />
      <img className="poster-1-child5" alt="" src="/undefined5.png" />
      <div className="miles-parent">
        <div className="miles">Miles</div>
        <div className="free-road-side-container">
          <p className="free-road-side">Free Road Side</p>
          <p className="free-road-side">Assistance</p>
        </div>
      </div>
    </div>
  );
};

export default Poster1;
